%spark
import org.apache.spark.streaming.twitter._
val ssc = new StreamingContext(sc, Seconds(10))
val tweets = TwitterUtils.createStream(ssc, None, Array("#cnn"))
//val tweets = TwitterUtils.createStream(ssc, None)
//tweets.saveAsObjectFiles("hdfs://sandbox.hortonworks.com:8020/test/twitter-spark/twitter_", ".txt")

val twt = tweets.window(Seconds(120))

case class Tweet(createdAt:Long, text:String, screenName:String)
twt.filter(_.getText != null).map(t=>
  Tweet(t.getCreatedAt().getTime()/1000, t.getText(), t.getUser().getScreenName())).foreachRDD(rdd=>{
    rdd.toDF().registerTempTable("tweets")
}
)

//twt.print

ssc.start()
